import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Settings = () => {
  const [doctorDetails, setDoctorDetails] = useState({
    fullName: '',
    email: '',
    phoneNumber: '',
    specialization: '',
    yearsOfExperience: '',
  });

  const [message, setMessage] = useState('');

  useEffect(() => {
    // Fetch doctor profile
    const fetchProfile = async () => {
      try {
        const token = localStorage.getItem('token');
        const { data } = await axios.get('/api/profile', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setDoctorDetails(data);
      } catch (error) {
        console.error('Error fetching profile:', error);
      }
    };

    fetchProfile();
  }, []);

  const handleChange = (e) => {
    setDoctorDetails({ ...doctorDetails, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const { data } = await axios.put('/api/update-profile', doctorDetails, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setMessage(data.message);
    } catch (error) {
      console.error('Error updating profile:', error);
      setMessage('Failed to update profile.');
    }
  };

  return (
    <div className="settings-page">
      <h1>Doctor Settings</h1>
      {message && <p>{message}</p>}
      <form onSubmit={handleSubmit}>
        <label>
          Full Name:
          <input
            type="text"
            name="fullName"
            value={doctorDetails.fullName}
            onChange={handleChange}
          />
        </label>
        <label>
          Email:
          <input
            type="email"
            name="email"
            value={doctorDetails.email}
            onChange={handleChange}
          />
        </label>
        <label>
          Phone Number:
          <input
            type="text"
            name="phoneNumber"
            value={doctorDetails.phoneNumber}
            onChange={handleChange}
          />
        </label>
        <label>
          Specialization:
          <input
            type="text"
            name="specialization"
            value={doctorDetails.specialization}
            onChange={handleChange}
          />
        </label>
        <label>
          Years of Experience:
          <input
            type="number"
            name="yearsOfExperience"
            value={doctorDetails.yearsOfExperience}
            onChange={handleChange}
          />
        </label>
        <button type="submit">Update Profile</button>
      </form>
    </div>
  );
};

export default Settings;
